mooie film

met Brendan Fraser, Josh Hutcherson en Anita Briem

Als de broer van een wetenschapper plotseling verdwijnt, besluit deze wetenschapper samen met zijn neefje en een gids op zoek te 
gaan naar zijn broer. Het drietal komt terecht in een bijzondere, maar ook gevaarlijke verloren wereld, ergens in het midden van 
de Aarde.
